    "You have deleted an option. That option has been removed from its criterion in the sample responses in the Learner Training step. You might have to select a new option for the criterion.": "\u05de\u05d7\u05e7\u05ea \u05d0\u05e4\u05e9\u05e8\u05d5\u05ea. \u05d0\u05e4\u05e9\u05e8\u05d5\u05ea \u05d6\u05d5 \u05d4\u05d5\u05e1\u05e8\u05d4 \u05de\u05d4\u05e7\u05e8\u05d9\u05d8\u05e8\u05d9\u05d5\u05df \u05e9\u05dc\u05d4 \u05d1\u05ea\u05e9\u05d5\u05d1\u05d5\u05ea \u05dc\u05d3\u05d5\u05d2\u05de\u05d4 \u05e9\u05d1\u05e9\u05dc\u05d1 \u05ea\u05e8\u05d2\u05d5\u05dc \u05d4\u05dc\u05d5\u05de\u05d3. \u05d9\u05d9\u05ea\u05db\u05df \u05e9\u05ea\u05e6\u05d8\u05e8\u05da \u05dc\u05d1\u05d7\u05d5\u05e8 \u05d0\u05e4\u05e9\u05e8\u05d5\u05ea \u05d7\u05d3\u05e9\u05d4 \u05e2\u05d1\u05d5\u05e8 \u05d4\u05e7\u05e8\u05d9\u05d8\u05e8\u05d9\u05d5\u05df.",
